import React from "react";
function Nav(props) {
  console.log("nav props", props);
  function toggleTheme(theme) {
    props.setMyTheme(theme === "light" ? "dark" : "light");
  }

  return (
    <div className="navbar">
      {/* <div className="aicon-menu"></div> */}
      <div
        className="nav-link  d-flex"
        onClick={() => {
          props.poMansRouting("home");
        }}
      >
        {/* <svg className="logo" viewBox="0 0 56 56">
          <title>aiyellow</title>
          <path d="M49,16V42H43V16h6m2-2H41V44H51V14Z" />
          <path
            className="cls-1"
            d="M21.5,18l14,24h-28l14-24m0-4L4,44H39L21.5,14Z"
          />
        </svg> */}

        <svg className="logo2" data-name="aiyellow64fill" viewBox="0 0 64 64">
          <rect class="cls-2" x="51" y="13" width="10" height="38" />
          <path d="M60,14V50H52V14h8m2-2H50V52H62V12Z" />
          <polygon class="cls-2" points="3.67 51 23.5 14.11 43.33 51 3.67 51" />
          <path
            class="cls-1"
            d="M23.5,16.22,41.65,50H5.35L23.5,16.22m0-4.22L2,52H45L23.5,12Z"
          />
        </svg>
        <svg className="logo2" data-name="aiyellow64" viewBox="0 0 64 64">
          <path d="M59,16V49H51V16H59m2-2H49V51H61V14Z" />
          <path
            className="cls-1"
            d="M24.5,18l18,31H6.47l18-31m0-4L3,51H46L24.5,14Z"
          />
        </svg>
        <svg className="logo2" data-name="aiyellow64fill" viewBox="0 0 64 64">
          <rect class="cls-2" x="51" y="13" width="11" height="38" />
          <path d="M61,14V50H52V14h9m2-2H50V52H63V12Z" />
          <polygon class="cls-2" points="2.73 51 24 14.01 45.27 51 2.73 51" />
          <path
            class="cls-1"
            d="M24,16,43.54,50H4.46L24,16m0-4L1,52H47L24,12Z"
          />
        </svg>
        {/* <svg className="logo" viewBox="0 0 56 56">
          <title>ai3</title>
          <path d="M5,44H40L22.5,14Zm3.48-2,14-24,14,24ZM41,14V44H51V14Zm8,28H43V16h6Z" />
        </svg> */}
      </div>
      <div
        className="nav-link"
        onClick={() => {
          props.poMansRouting("dataViz");
        }}
      >
        DataViz
      </div>
      <div
        className="nav-link"
        onClick={() => {
          props.poMansRouting("portfolio");
        }}
      >
        Portfolio
      </div>
      <div
        className="sunlight-nighttime "
        onClick={() => toggleTheme(props.myTheme)}
      >
        <span className="mr-1">Theme</span>
        {props.myTheme === "light" && <div className="aicon-sun-outline"></div>}
        {props.myTheme === "dark" && <div className="aicon-moon"></div>}
      </div>
    </div>
  );
}

export default Nav;
